import React from 'react';
import './css/UI.css';
import profilePicture from '../src/cyberp.png';

function Head(){
    return(
      <div className="Head Card">
      <div className="card-body">Head Body</div>
      <img src={profilePicture} alt="profilePicture"/>
      </div>
  );
}
export default Head;
